brightness.',30778950.00,45,'2021-12-26 11:42:56',0),(9,1,'Alienware m15 R4 Gaming Laptop, 15.6 inch Full HD (FHD)','15.6-inch FHD (Full HD 1920 x 1080) 144Hz 7ms 300-nits 72% color gamut\r\n10th Generation Intel Core i7-10870H (8-Core, 16MB Cache, up to 5.0GHz Max Turbo Frequency)\r\n16GB 2933MHz DDR4 , 512 GB M.2 PCIe NVMe SSD\r\nNVIDIA GeForce RTX 3060 6GB GDDR6\r\nKiller Wi-Fi 6 AX1650i 802.11ax 2x2 Wireless LAN + Bluetooth 5.1',41038600.00,23,'2021-12-26 11:46:33',0),(10,1,'2021 Apple MacBook Pro (14-inch, Apple M1 Pro chip with 10‑core CPU and 16‑core GPU, 16GB RAM, 1TB SSD) - Silver','Apple M1 Pro or M1 Max chip for a massive leap in CPU, GPU, and machine learning performance\r\nUp to 10-core CPU delivers up to 3.7x faster performance to fly through pro workflows quicker than ever\r\nUp to 32-core GPU with up to 13x faster performance for graphics-intensive apps and games\r\n16-core Neural Engine for up to 11x faster machine learning performance\r\nLonger battery life, up to 17 hours\r\nUp to 64GB of unified memory so everything you do is fast and fluid\r\nUp to 8TB of superfast SSD storage launches apps and opens files in an instant',57102150.00,124,'2021-12-26 11:49:50',0),(11,6,'Samsung Galaxy A52 5G, Factory Unlocked Smartphone, Android Cell Phone, Water Resistant, 64MP Camera, US Version, 128GB, Black','Game, Stream & Binge On: Watch your favorite shows, work on your gaming, and keep your playlist blasting with Galaxy A52 5G\'s long-lasting battery\r\nWhen you do need a power boost, Super-Fast Charging will have you back up in no time. Dual-SIM. SIM size-Nano-SIM (4FF)',9688400.00,34,'2021-12-26 11:57:44',0),(12,3,'Battlefield 2042 - PC','The next generation of all-out war is here.\r\nExperience ever-changing battle conditions and gameplay challenges.\r\nUnleash your combat creativity with weapons, vehicles and equipment inspired by the near-future of 2042.\r\nChoose your role on the battlefield and form hand-tailored squads through the new Specialist system.',909887.00,23,'2021-12-26 12:00:58',0),(13,1,'ASUS TUF Gaming F17 Gaming Laptop, 17.3” 144Hz FHD IPS-Type Display','NVIDIA GeForce GTX 1650 Ti 4GB GDDR6 Graphics up to 1585MHz at 80W TGP.\r\nQuad-core Intel Core 15-10300H Processor (8M Cache, up to 4.5 GHz, 4 cores)\r\n144Hz17.3” Full HD (1920x1080) IPS-Type display\r\n512GB PCIe NVMe M.2 SSD | 8GB DDR4 2933MHz RAM\r\nDurable MIL-STD-810H military standard construction\r\nComes with Windows 10 Home and a FREE upgrade to Windows 11 (when available1)',19399650.00,45,'2021-12-26 12:03:34',0),(14,1,'ASUS VivoBook Flip 14 Thin and Light 2-in-1 Laptop, 14” FHD Touch','Latest 11th generation Intel Core i3-1115G4 Processor (6M Cache, up to 4.1 GHz, 2 cores)\r\nWindows 10 Home in S mode, 128GB SSD and 4GB LPDDR4X RAM\r\n14” Full HD Wideview touch display with up to 178° viewing angle optimized for entertainment\r\n12.9” wide, 0.7” thin with a stunning 82% screen-to-body ratio; Brushed aluminum chassis and lightweight at 3.31 pounds',10054000.00,76,'2021-12-26 12:05:49',0),(15,1,'ASUS TUF Dash 15 (2021) Ultra Slim Gaming Laptop, 15.6” 144Hz FHD','NVIDIA GeForce RTX 3050 Ti 4GB GDDR6 up to 1585MHz at 60W (75W with Dynamic Boost 2.0)\r\nIntel Core i7-11370H processor (12M Cache, up to 4.8GHz)\r\n15.6” 144Hz IPS-Type Full HD (1920x1080) display with adaptive sync\r\n8GB DDR4 RAM | 512GB PCIe NVMe M.2 SSD | Backlit Precision Gaming Keyboard\r\n0.8” thin, 4.4 lbs ultraportable form-factor\r\nComes with Windows 10 Home and a FREE upgrade to Windows 11 (when available1)',21684650.00,56,'2021-12-26 12:07:50',0),(16,1,'Lenovo Chromebook S330 Laptop, 14-Inch FHD (1920 x 1080) Display','High performance laptop: The Chromebook S330 is equipped with a MediaTek MTK8173C Processor, Chrome OS, 4 GB LPDDR3, 64 GB eMMC 5.1 and so much more\r\nSleek and stylish design: Sleek, stylish and secure, the Lenovo Chromebook S330 is less than one inch thin and 3.3 pounds light with a 14-inch FHD display. Perfect for day-to-day computing and multi